import React,{useState, Component} from "react";
import "./App.css";
import axios from "axios";

export default class App extends Component{
  constructor() {
    super();
    this.state = {
       title: "Click here"
    }
 }

  test() {
    axios.get("http://localhost:3000/questions").then((res) => console.log(res));
  }

  //const [text,setText] = useState();
/*

*/


  handleClick(e) {
    var data = {
      question: "test2",
    };
    const headers = {
      "Content-Type": "application/json",
    };

    e.preventDefault();
    axios
      .post("http://localhost:3000/questions", data, {
        headers: headers,
      })
      .then((res) => console.log(res))
      .catch(err => console.log(err));
  }


  addItemToCart(res) {
    console.log(res.data.text);
    this.setState({text: res.data.text})
  }


  handleQuestion(e){
    e.preventDefault();
    var pom = Math.floor(Math.random() * 3) + 1;
    axios
      .get("http://localhost:3000/questions/" + pom)
      .then((res) => console.log(res))
      .catch(err => console.log(err));
  }

render(){
  return (
    <div className="App">
      <header className="App-header">
        <ul>
          {this.state.text}

        </ul>
        <a href="#" onClick={this.handleClick}>
          Kliknij mnie
        </a>
        <a href="#" onClick={this.handleQuestion}>
          Kliknij mnieee
        </a>
      </header>
    </div>
  );
}
}
